import styled from "styled-components"
import Carrossel from "./Carrossel";
import Pesquisa from ".Pesquisa";
import Principal from "./Principal";

const CorpoStyled = styled.header`
    display: flex;
    width: 100vw;
    height: 20vh;
    background-color: gray;
`

function Corpo() {

    return (
        <CorpoStyled>
           <Carrossel />
           <Principal />
        </CorpoStyled>
    )
}
export default Corpo;
